import { createContext } from "react";

interface IPanelContext {
    changeStore: {
        setBrands: (newBrans: string) => void,
    },
    store: {
        brands: string
    }
}

const PanelContext = createContext<Partial<IPanelContext>>({})

export default PanelContext
